import React from 'react';
import "./Style/Suzie.css"
import Navbar from './Navbar';

import Breadcrumbs from '@mui/material/Breadcrumbs';
import Link from '@mui/material/Link';
import NavigateNextIcon from '@mui/icons-material/NavigateNext';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import Button from '@mui/material/Button';
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';
import FormControl from '@mui/material/FormControl';
import InputLabel from '@mui/material/InputLabel';
import OutlinedInput from '@mui/material/OutlinedInput';
import SearchIcon from '@mui/icons-material/Search';


function Suzie(){
	return <div class="Suzie">
    <Navbar/>
  <div class="suzie">
  <br/>
  <div class="searchBar">
      <FormControl >
        <InputLabel> Search...</InputLabel>
        <OutlinedInput size="small"endAdornment={<SearchIcon/>}/>
      </FormControl>
    </div>
  <br/>
  <br/>
  <br/>
		<Breadcrumbs separator=<NavigateNextIcon/>>
  			<Link underline="none" color="inherit">
  				You are here :
  			</Link>
  			<Link href="./OurCats" underline="hover" color="inherit">
  				Our Cats
  			</Link>
  			<Link underline="never">
  				Suzie
  			</Link>
  		</Breadcrumbs>
  		<h1> Suzie </h1>
  		<br/>
  		Looking for love !
  		<br/>
  		Female Domestic : Shorthair Cat
  		<br/>
  		<div id="suzieImages">
  			<div id="bigImage">
  				<img href="./Meferedia/cat1"/>
  			</div>
  			<div id="smallImages">
  				<ImageList sx={{ width: 450, height: 450 }} cols={3} rowHeight={164}>
      {itemData.map((item) => (
        <ImageListItem key={item.img}>
          <img
            src={`${item.img}?w=164&h=164&fit=crop&auto=format`}
            srcSet={`${item.img}?w=164&h=164&fit=crop&auto=format&dpr=2 2x`}
            alt={item.title}
            loading="lazy"
          />
        </ImageListItem>
      ))}
    </ImageList>
  			</div>
  		</div>
      <div id="suzieText">
  		<h3> About Suzie </h3>
  		<p> Suzie is a little shy at first, but once she has settled in she turns into an attentive and purring lap cat. She loves pats and chin tickles and has super soft fur, a fluffy tail, and gorgeous green eyes. We noticed she’s not so sure about men with deep voices, but she can be convinced to trust you if you have plenty of treats on offer.</p>
  		<br/>
  		<b> Age</b>: estimated 3-5 years
  		<br/>
  		<b> Microchip</b>: 991003001479829
  		<br/>
  		<b> Location</b>: Madrid, Spain
  		<br/>
  		<b> Adoption fee</b>: $220
  		<br/>
  		<br/>
  		<h3> Adoption details </h3>
  		<p> Please complete our online Adoption Application form to arrange an introductory "date" with one of our special kittens or adult cats that are eagerly awaiting their new home.</p>
  		<br/>
      <a href="./AdoptionForm">
  		<Button variant="contained" endIcon={<ArrowForwardIosIcon/>}>Go to the Adoption Form </Button>
      </a>
  		<br/>
  		<p> Effort has been directed to each and everyone of our furry mates to ensure we understand each feline's personality profile and special needs in order to suitably match you with your new furry companion. All our kittens and cats look forward to meeting you!</p>
  		<br/>
  		<p> As a not-for-profit street cat rescue organisation our adoption fees only cover the costs incurred from desexing and all initial vet work.</p>
		  </div>
    <br/>
		<br/>
		<br/>


  		</div>
	</div>;
}

const itemData = [
  {
    img: 'https://images.unsplash.com/photo-1551963831-b3b1ca40c98e',
    title: 'Breakfast',
  },
  {
    img: 'https://images.unsplash.com/photo-1551782450-a2132b4ba21d',
    title: 'Burger',
  },
  {
    img: 'https://images.unsplash.com/photo-1522770179533-24471fcdba45',
    title: 'Camera',
  },
  {
    img: 'https://images.unsplash.com/photo-1444418776041-9c7e33cc5a9c',
    title: 'Coffee',
  },
  {
    img: 'https://images.unsplash.com/photo-1533827432537-70133748f5c8',
    title: 'Hats',
  },
  {
    img: 'https://images.unsplash.com/photo-1558642452-9d2a7deb7f62',
    title: 'Honey',
  },
  {
    img: 'https://images.unsplash.com/photo-1516802273409-68526ee1bdd6',
    title: 'Basketball',
  },
  {
    img: 'https://images.unsplash.com/photo-1518756131217-31eb79b20e8f',
    title: 'Fern',
  },
  {
    img: 'https://images.unsplash.com/photo-1597645587822-e99fa5d45d25',
    title: 'Mushrooms',
  },
];

export default Suzie;
